DROP PROCEDURE IF EXISTS `sfsp_getHourlyDrill`$$
CREATE DEFINER=`adminqc`@`localhost` PROCEDURE `sfsp_getHourlyDrill` (IN `inp_date` DATE, IN `group_type` VARCHAR(1), IN `total_hours` DOUBLE, IN `start_hour` INT, IN `machine_id` INT)  BEGIN
	DECLARE queryStr TEXT;
    DECLARE sumQryStr TEXT;
    DECLARE finalQryStr TEXT;
    DECLARE cnt INT;
    DECLARE selectQryStr TEXT;
    DECLARE groupTypeFrom TEXT;
    DECLARE groupTypeWhere TEXT;    
            
    SET cnt = 0;
    SET queryStr=" ";
    SET sumQryStr=" ";
    
	CASE  group_type
		WHEN 'T' THEN
			SET groupTypeFrom=", sfs_tool_opr sto ";
            SET groupTypeWhere=CONCAT(" sdi.tag_id=sto.tag_id AND sdi.eq_code=se.code AND se.id=",machine_id," ");
			SET selectQryStr=" SELECT sto.tag_id commonName, sto.name descp, ";
		WHEN 'P' THEN
			SET groupTypeFrom=", sfs_dc_po sdp, sfs_tool_opr sto ";
            SET groupTypeWhere=CONCAT(" sdi.tag_id=sto.tag_id AND sdi.order_id=sdp.id AND sdi.eq_code=se.code AND se.id=",machine_id," ");
			SET selectQryStr=" SELECT sdp.order_number commonName, sdp.order_number descp, ";
		ELSE
			SET groupTypeFrom=" ";
            SET groupTypeWhere=CONCAT(" sdi.eq_code=se.code AND se.id=",machine_id);
			SET selectQryStr=" SELECT se.code commonName, se.descp, ";
	END CASE; 

 CASE  group_type
	WHEN 'M' THEN
		WHILE (cnt != total_hours)
		DO
		SET queryStr= CONCAT(queryStr, "SUM(sdh.H",start_hour+cnt,") AS 'H",start_hour+cnt,"', ");
		IF (cnt < (total_hours-1)) THEN
		SET sumQryStr= CONCAT(sumQryStr, "sdh.H",start_hour+cnt,"+");
		ELSE 
		SET sumQryStr= CONCAT(sumQryStr, "sdh.H",start_hour+cnt,"),0) total_count");
		END IF;
		SET cnt = cnt+1;
		END WHILE;
    ELSE
		WHILE (cnt != total_hours)
		 DO
		SET queryStr= CONCAT(queryStr, "ROUND(SUM(sdh.H",start_hour+cnt,")*sto.no_of_items_per_oper,0) AS 'H",start_hour+cnt,"', ");
		IF (cnt < (total_hours-1)) THEN
		SET sumQryStr= CONCAT(sumQryStr, "sdh.H",start_hour+cnt,"+");
		ELSE 
		SET sumQryStr= CONCAT(sumQryStr, "sdh.H",start_hour+cnt,")*sto.no_of_items_per_oper,0) total_count");
		END IF;
		SET cnt = cnt+1;
		END WHILE;
    END CASE; 
    
    SET @finalQryStr=CONCAT("SELECT * FROM (",selectQryStr,total_hours," no_of_hours,",start_hour," start_hour,",
		queryStr,"ROUND(SUM(",sumQryStr," FROM sfs_data_hourly sdh, sfs_data_info sdi, sfs_equipment se ",groupTypeFrom," WHERE sdh.data_info_id=sdi.id AND ",groupTypeWhere," AND sdh.cur_date='",inp_date,"' GROUP BY commonName ) AS innerTab WHERE total_count<>0");
	
    -- SELECT @finalQryStr;
    
	PREPARE stmt FROM @finalQryStr;
	EXECUTE stmt;

END$$

DROP PROCEDURE IF EXISTS `sfsp_getOverallOEE`$$
CREATE DEFINER=`adminqc`@`localhost` PROCEDURE `sfsp_getOverallOEE` (IN `companyId` INT, IN `plantId` INT, IN `workcenterId` INT, IN `machineId` INT, IN `curDate` DATE, IN `shiftId` INT, IN `group_type` VARCHAR(1), IN `order_val` VARCHAR(45))  NO SQL
BEGIN
	DECLARE runTime INT;
    DECLARE idleTime INT;
    DECLARE breakDownTime INT;
    DECLARE benchMarkTime INT;
    DECLARE noOfItemsPerOper FLOAT;
    DECLARE mulFactor FLOAT;
    DECLARE okCount INT;
    DECLARE rejCount INT;
    
    SELECT  
		SUM(IF(sqt.id=1,sd.count*IF(group_type='T' OR group_type='P',sto.no_of_items_per_oper,1),0)) OK, 
        SUM(IF(sqt.id=2,sd.count*IF(group_type='T' OR group_type='P',sto.no_of_items_per_oper,1),0)) REJ
	INTO 
		okCount,rejCount
    FROM  
		sfs_data sd, 
		sfs_data_info sdi, 
		sfs_quality_code sqc, 
		sfs_equipment seq,
        sfs_quality_type sqt,
        sfs_tool_opr sto,
		sfs_dc_po sdp,
		sfs_shifts shf
	WHERE   
		sd.data_info_id=sdi.id AND 
		sd.quality_codes_id=sqc.id AND 
		sqc.quality_type_id=sqt.id AND
		sdi.order_id = sdp.id AND
        sdi.tag_id=sto.tag_id AND
        sdi.eq_code=seq.code AND
        seq.id=machineId AND
		shf.id=shiftId AND
        sd.start_time >= TIMESTAMP(curDate,TIME(shf.in_time)) AND
		sd.end_time <= TIMESTAMP(If(HOUR(shf.out_time) > HOUR(shf.in_time),curDate,DATE_ADD(curDate,INTERVAL 1 DAY)),TIME(shf.out_time));
    
        
	SELECT 
		SUM(CASE WHEN src.reason_type_id = 1 THEN TIMESTAMPDIFF(SECOND,se.start_time,se.end_time) ELSE 0 END),
		SUM(CASE WHEN src.reason_type_id = 2 THEN TIMESTAMPDIFF(SECOND,se.start_time,se.end_time) ELSE 0 END),
		SUM(CASE WHEN src.reason_type_id = 3 THEN TIMESTAMPDIFF(SECOND,se.start_time,se.end_time) ELSE 0 END)
	INTO
		@runTime, @idleTime, @breakDownTime
	FROM 
		sfs_event se,
		sfs_data_info sdi,
        sfs_tool_opr sto, 
        sfs_part_fg spf,
		sfs_equipment seq,
		sfs_reason_code src,
		sfs_shifts shf
	WHERE
		se.data_info_id=sdi.id AND
		sdi.eq_code=seq.code AND
        sto.part_fg_id=spf.id AND 
        sdi.tag_id=sto.tag_id AND 
		src.id=se.reason_code_id AND
		seq.id=machineId AND
				shf.id=shiftId AND
		se.start_time >= TIMESTAMP(curDate,TIME(shf.in_time)) AND
		se.end_time <= TIMESTAMP(If(HOUR(shf.out_time) > HOUR(shf.in_time),curDate,DATE_ADD(curDate,INTERVAL 1 DAY)),TIME(shf.out_time));
    
		SELECT 	
		machine_status,
        (ROUND(((@runTime-(@idleTime + @breakDownTime))/@runTime),2) * ROUND((ideal_cycle_time/@runTime) ,2) * ROUND(IFNULL(1-(lost_quality_time/ideal_cycle_time),0),2) ) * 100 AS oee_per,
        image_filename,
        active_reason_code,
        active_reason_color,
        ROUND(((@runTime-(@idleTime + @breakDownTime))/@runTime)*100,2) AS availability_perc,
        planned_production_time,
        @runTime run_time,
        ROUND((@runTime/planned_production_time)*100,2) AS run_time_perc,
        @idleTime AS idle_time,
        ROUND((@idleTime/planned_production_time)*100,2) idle_time_perc,
		@breakDownTime breakdown_time,
		ROUND((@breakDownTime/planned_production_time) * 100,2) breakdown_time_perc,
		ROUND((ideal_cycle_time/@runTime) * 100,2) performance_perc,
		ideal_cycle_time,
		ROUND(@runTime/ok_Count,0) average_time_per_part,
		benchmark_time,
		ROUND(IFNULL(1-(lost_quality_time/ideal_cycle_time),0)*100,2) quality_perc,
		(ok_Count+rejected_Count) total_Count,
		ok_Count,
		rejected_Count,
		'#E29D21' oee_perc_color,
		'#FDCA6C' availability_perc_color,
		'#DB4F31' performance_perc_color,
		'#1AD34E' quality_perc_color
	FROM 	
		(SELECT 	
		seq.conn_state AS machine_status,
        if(seq.image_file_name IS NULL,'default.jpg',seq.image_file_name) AS image_filename,
        src.message AS active_reason_code,
        src.color_code AS active_reason_color,
        soid.sched_prod_time*60 AS planned_production_time,
        sto.bm_prod_time*60 AS benchmark_time,
        SUM((soid.sched_prod_time*60-(soid.planned_down_time+soid.unplanned_down_time))) AS run_time,
        SUM(soid.unplanned_down_time) unplanned_downtime,
        okCount ok_Count,
		rejCount rejected_Count,
        SUM(okCount*(sto.bm_prod_time)) ideal_cycle_time,
		SUM(rejCount*(sto.bm_prod_time)) lost_quality_time
	FROM 	
		sfs_oee_input_data soid,
        sfs_data_info sdi, 
        sfs_tool_opr sto, 
        sfs_part_fg spf,
		sfs_equipment seq,
        sfs_reason_code src
	WHERE
		soid.data_info_id=sdi.id AND 
		sdi.eq_code = seq.code AND
        sto.part_fg_id=spf.id AND 
        sdi.tag_id=sto.tag_id AND 
        src.id=seq.reason_code_id AND
        soid.cur_date=curDate AND
        soid.shift_id=shiftId AND
		seq.id=machineId) AS innerTable;             
END$$

