--
-- Triggers `sfs_event`
--
DROP TRIGGER IF EXISTS `sfs_event_AFTER_INSERT`;
DELIMITER $$
CREATE TRIGGER `sfs_event_AFTER_INSERT` AFTER INSERT ON `sfs_event` FOR EACH ROW BEGIN
  DECLARE shiftTime DATETIME;
    DECLARE currentDate DATE;
    DECLARE currentTime TIME;
    DECLARE schedProdTime INT;
    DECLARE plandDownTime INT;
    DECLARE shiftInTime TIME;
    DECLARE shiftDate DATE;
    DECLARE shiftID INT;
    DECLARE plantId INT;
    DECLARE oeeInputId INT;
    DECLARE cnt INT;
    DECLARE benProdTime FLOAT;
    DECLARE noOfItemsPerOper FLOAT;
    DECLARE eqCode VARCHAR(45);
    DECLARE changDate DATE;
    
  SET @cnt=0; 
    SET @currentDate = DATE(new.end_time);
    SET @currentTime = TIME(new.end_time);
    SET @plantId = (SELECT plant_id FROM sfs_workcenter WHERE id=(SELECT wc_id FROM sfs_equipment WHERE code=(SELECT eq_code FROM sfs_data_info WHERE id=new.data_info_id)));
  
    SELECT 
    sto.bm_prod_time*60, sto.no_of_items_per_oper, sdi.eq_code 
  INTO
    @benProdTime, @noOfItemsPerOper, @eqCode
  FROM 
    sfs_tool_opr sto, sfs_part_fg spf, sfs_data_info sdi 
  WHERE 
    sto.part_fg_id=spf.id AND 
        sdi.tag_id=sto.tag_id AND 
        sdi.id=new.data_info_id;
    
   SELECT 
    id, MAX(DATE(start_date)), TIME(in_time), total_minutes,IF(is_break_availb='N',0,SUM(TIMESTAMPDIFF(SECOND,lb_starttime,lb_endtime)+TIMESTAMPDIFF(SECOND,sb1_starttime,sb1_endtime)+TIMESTAMPDIFF(SECOND,sb2_starttime,sb2_endtime))),CONCAT(IF(TIME(@currentTime) >= TIME(in_time),@currentDate,DATE_SUB(@currentDate,INTERVAL 1 DAY))," ",TIME(in_time))
  INTO
        @shiftID, @shiftDate, @shiftInTime, @schedProdTime, @plandDownTime, @changDate
  FROM  
    sfs_shifts 
  WHERE 
    DATE(start_date) <= @currentDate AND 
    plant_id=@plantId AND 
    type='NORMAL'AND
   CONCAT(If(HOUR(@currentTime) >= HOUR(in_time),start_date,DATE_ADD(start_date,INTERVAL 1 DAY))," ",@currentTime) BETWEEN in_time AND out_time;
   
SET @currentDate = DATE(@changDate);
  SELECT 
    COUNT(*), id 
  INTO @cnt, @oeeInputId
  FROM 
    sfs_oee_input_data
  WHERE
    cur_date=@currentDate AND
        shift_id = @shiftID AND
        start_time = CONCAT(DATE(cur_date)," ",@shiftInTime) AND
        data_info_id=new.data_info_id;
        
  IF( new.reason_code_id <> 1 ) THEN
    IF (@cnt = 0)
    THEN
        total_accept_qty, total_defect_qty) 
      VALUES ( @currentDate, @shiftID, CONCAT(@currentDate," ",@shiftInTime),new.end_time, new.data_info_id, @benProdTime, @schedProdTime, @plandDownTime, TIMESTAMPDIFF(SECOND,CONCAT(@currentDate," ",@shiftInTime),new.end_time), 0, 0 );
    ELSE
      UPDATE sfs_ioentdb.sfs_oee_input_data
      SET   
        unplanned_down_time = unplanned_down_time + TIMESTAMPDIFF(SECOND,end_time,new.end_time),
        end_time = new.end_time,
        total_accept_qty = 0,
        total_defect_qty = 0
      WHERE shift_id = @shiftID AND cur_date=DATE(new.start_time) AND data_info_id = new.data_info_id;
    END IF;
  ELSE
	IF (@cnt = 0)
    THEN
        total_accept_qty, total_defect_qty) 
      VALUES ( @currentDate, @shiftID, CONCAT(@currentDate," ",@shiftInTime),new.end_time, new.data_info_id, @benProdTime, @schedProdTime, 0, 0, 0, 0 );
    END IF;
  END IF;
    
        UPDATE sfs_equipment SET reason_code_id=new.reason_code_id WHERE code=@eqCode;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `sfs_event_AFTER_UPDATE`;
DELIMITER $$
CREATE TRIGGER `sfs_event_AFTER_UPDATE` AFTER UPDATE ON `sfs_event` FOR EACH ROW BEGIN
  DECLARE shiftTime DATETIME;
    DECLARE currentDate DATE;
    DECLARE currentTime TIME;
    DECLARE shiftInTime TIME;
    DECLARE shiftDate DATE;
    DECLARE shiftID INT;
    DECLARE plantId INT;
    DECLARE oeeInputId INT;
    DECLARE oeeEndTime DATETIME;
    DECLARE cnt INT;
	DECLARE changDate DATE;
    
  SET @cnt=0;
    SET @currentDate = DATE(new.end_time);
    SET @currentTime = TIME(new.end_time);
    SET @plantId = (SELECT plant_id FROM sfs_workcenter WHERE id=(SELECT wc_id FROM sfs_equipment WHERE code=(SELECT eq_code FROM sfs_data_info WHERE id=new.data_info_id)));
          
    SELECT 
    id, MAX(DATE(start_date)), TIME(in_time),
	CONCAT(IF(TIME(@currentTime) >= TIME(in_time),@currentDate,DATE_SUB(@currentDate,INTERVAL 1 DAY))," ",TIME(in_time))
  INTO
        @shiftID, @shiftDate, @shiftInTime, @changDate
  FROM  
    sfs_shifts 
  WHERE 
    DATE(start_date) <= @currentDate AND 
    plant_id=@plantId AND 
    type='NORMAL'AND
   CONCAT(If(HOUR(@currentTime) >= HOUR(in_time),start_date,DATE_ADD(start_date,INTERVAL 1 DAY))," ",@currentTime) BETWEEN in_time AND out_time;
  
  SET @currentDate = DATE(@changDate);
   IF( new.reason_code_id <> 1 ) THEN
    UPDATE sfs_ioentdb.sfs_oee_input_data
    SET   
      unplanned_down_time = unplanned_down_time + TIMESTAMPDIFF(SECOND,end_time,new.end_time),
      end_time = new.end_time,
      total_accept_qty = 0,
      total_defect_qty = 0
    WHERE shift_id = @shiftID AND cur_date=DATE(new.start_time) AND data_info_id = new.data_info_id;
  END IF;
    
    UPDATE sfs_equipment SET reason_code_id=new.reason_code_id WHERE code=(SELECT eq_code FROM sfs_data_info WHERE id=new.data_info_id);
END
$$
